func Test452_1_1(t *testing.T) {
	// insert your input
	points := [][]int{{10, 16}, {2, 8}, {1, 6}, {7, 12}}
	output := 2

	// insert your function
	result := findMinArrowShots(points)

	if output != result {
		t.Errorf("Expected %d, but got %d", output, result)
	}
}

